export const st = {
    container: {
        display: "flex",
        flexFlow: "column",
        justifyContent: "space-evenly",
        alignContent: "center",
        width: "100%",
        height: "100%",
    },
    offer: {
        display: "flex",
        fontSize: "2em",
        alignItems: "center",
        justifyContent: "center",
    },
    main: {
        display: "flex",
        flexFlow: "row",
        justifyContent: "space-evenly",
        alignContent: "center",
        width: "100%",
        height: "100%",
    },
    offerContainer: {
        display: "flex",
        flexFlow: "column",
        justifyContent: "space-evenly",
        alignContent: "center",
        width: "100%",
        height: "100%",
    },
    offerButtons: {
        display: 'flex',
        flexFlow: 'row',
        width: "100%",
    },
    button: {
        fontWeight: 500,
        fontSize: "1em",
    },
    price: {
        display: 'flex',
        alignSelf: 'center',
        fontSize: "2em",
        fontWeight: 900,
    },
    sidebar: {
        display: 'flex'
    }
}
